-- public.cat_food_and_treats definition

-- Drop table

-- DROP TABLE public.cat_food_and_treats;

CREATE TABLE public.cat_food_and_treats (
                                            id bigserial NOT NULL,
                                            name varchar(255) NULL,
                                            "type" varchar(255) NULL,
                                            food_type varchar(255) NULL,
                                            purchase_date date NOT NULL,
                                            purchase_price numeric(10, 2) NULL,
                                            weight numeric(10, 2) NULL,
                                            calories_per_unit numeric(38, 2) NULL,
                                            calories_per_gram numeric(38, 2) NULL,
                                            supplier varchar(255) NULL,
                                            crude_protein numeric(5, 2) NULL,
                                            crude_fat numeric(5, 2) NULL,
                                            ash numeric(5, 2) NULL,
                                            crude_fiber numeric(5, 2) NULL,
                                            phosphorus numeric(5, 2) NULL,
                                            calcium numeric(5, 2) NULL,
                                            moisture numeric(5, 2) NULL,
                                            sodium numeric(5, 2) NULL
);







